package org.w3c.www.protocol.http.cache.push;

import org.w3c.www.protocol.http.cache.CacheStore;
import java.io.File;

/**
 * Trival subclass of CacheStore which simply provides access to 
 * getNewEntryFile for members of this package.
 *
 * If CacheStore.getNewEntryFile was public, this class would not be 
 * necessary.
 *
 * @author Paul Henshaw, The Fantastic Corporation, Paul.Henshaw@fantastic.com
 * @version $Revision: 1.1 $
 * $Id: PushCacheStore.java,v 1.1 2001/10/03 15:00:46 ylafon Exp $
 */
class PushCacheStore extends CacheStore {

    /**
     * Calls super.getNewEntryFile()
     */
    protected File getNewEntryFile() {
	return(super.getNewEntryFile());
    }
}
